import React from 'react';
import { View, Text, StyleSheet } from 'react-native';

function HomeScreen({ route }) {
  const { user } = route.params;

  return (
    <View style={styles.container}>
      <Text style={styles.headerText}>Welcome, {user.name}!</Text>
      <Text style={styles.detailText}>Email: {user.email}</Text>
      <Text style={styles.detailText}>User Type: {user.userType}</Text>
      <Text style={styles.detailText}>Country of Origin: {user.countryOfOrigin}</Text>
      <Text style={styles.detailText}>Date of Birth: {new Date(user.dateOfBirth).toDateString()}</Text>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    padding: 16,
    backgroundColor: '#fff',
  },
  headerText: {
    fontSize: 24,
    marginBottom: 16,
  },
  detailText: {
    fontSize: 16,
    marginBottom: 8,
  },
});

export default HomeScreen;
